import React from 'react';
import ReactDOM from 'react-dom';
import * as allIcons from '../components/common/icons';
import * as serviceWorker from '../serviceWorker';
import { AnnotationType } from '../types';

const allIconKeys = Object.keys(allIcons);

ReactDOM.render(
  <div style={{ padding: 32 }}>
    <h1>Annotation Tools</h1>
    <ul>
      {Object.values(AnnotationType).map((tool) => (
        <li key={tool}><a href={`/${tool}.html`}>{tool}</a></li>
      ))}
    </ul>
    <h1>Icons</h1>
    <div style={{ display: 'flex', flexWrap: 'wrap' }}>
      {Object.values(allIcons).map((Comp, i) => (
        <div
          key={allIconKeys[i]}
          style={{ width: 160, height: 160 }}
        >
          <div style={{ height: 64, fontSize: 48, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
            <Comp />
          </div>
          <div style={{ fontSize: 12, fontFamily: 'sans-serif', textAlign: 'center', marginTop: 12 }}>
            {allIconKeys[i]}
          </div>
        </div>
      ))}
    </div>
  </div>,
  document.getElementById('root'),
);

serviceWorker.unregister();
